exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://www.kanshufou.com/${bid}/index.html`,{cleaner:html=>cleanCatalogWrapper(html,/class="books_li"[^>]*>/,"</dl>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};